import {RadarChart, Legend, PolarAngleAxis, PolarGrid, Radar} from "recharts";

function Performance(){
    const data = [
        {
            value: 80,
            kind: 1
        },
        {
            value: 120,
            kind: 2
        },
        {
            value: 140,
            kind: 3
        },
        {
            value: 50,
            kind: 4
        },
        {
            value: 200,
            kind: 5
        },
        {
            value: 90,
            kind: 6
        }
    ]
    // Rotate radar to start with intensity
    const angleStart = 210

    // Format kind
    const titleKind = {
        1: 'Cardio',
        2: 'Energie',
        3: 'Endurance',
        4: 'Force',
        5: 'Vitesse',
        6: 'Intensité',
    }

    return (
        <>
                <RadarChart
                    cx="50%"
                    cy="50%"
                    outerRadius="65%"
                    startAngle={angleStart}
                    endAngle={angleStart + 360}
                    data={data}
                >
                    <PolarGrid />
                    <PolarAngleAxis
                        dataKey="kind"
                        tickFormatter={titleKind}
                        tick={{ fill: '#FFFFFF', fontSize: '0.875em'}}
                    />
                    <Radar
                        legendType="none"
                        dataKey="value"
                        stroke="#E60000"
                        fill="#E60000"
                        fillOpacity={0.7}
                    />
                    <Legend />
                </RadarChart>
        </>
    )
}
export default Performance;
